import React from "react";
import 'boostrap/dist/css/boostrap.min.css'
import DataTable from "react-data-table-component";

const studentsTable = [
    {name:"Alvaro Sanchez Monteagudo", city: "Valencia", country:"España", phone: "+ 34 657852546", email: "smoteagudo@gmail.com"},
    {name:"Alvaro Sanchez Monteagudo", city: "Valencia", country:"España", phone: "+ 34 657852546", email: "smoteagudo@gmail.com"},
    {name:"Alvaro Sanchez Monteagudo", city: "Valencia", country:"España", phone: "+ 34 657852546", email: "smoteagudo@gmail.com"},
]

const columns = [
    {
        name: "Nombre",
        selector: 'name',
        sortable: true,
    },
    {
        name: "Ciudad",
        selector: 'city',
        sortable: true,
    },{
        name: "País",
        selector: 'country',
        sortable: true,
    },{
        name: "Teléfono",
        selector: 'phone',
        sortable: true,
    },{
        name: "Email",
        selector: 'email',
        sortable: true,
    },
]

function StudentsTable() {
    return(
        <div>
            <DataTable
                columns = {columns}
                data = {studentsTable}
                title = "Candidates"


            />

        </div>

    );
}

export { StudentsTable }
